#include <iostream>
#include <vector>
#include <algorithm>

using namespace std;

class Solution 
{
public:
    int subarraysDivByK(vector<int>& A, int K) 
    {
        if (A.empty())
        {
            return 0;
        }

        int size = A.size();
        vector<int> sum_before_this_num(size, 0);

        sum_before_this_num[0] = A[0];
        for (int i=1; i<size; ++i)
        {
            sum_before_this_num[i] = (sum_before_this_num[i-1] + A[i]);
        }
        for (int i=0; i<size; ++i)
        {
            sum_before_this_num[i] %= K;
        }

        sort(sum_before_this_num.begin(), sum_before_this_num.end());

        int ret = 0;

        int sum_subscrib = 0;
        int same_number_nums = 0;
        while (sum_subscrib<size)
        {
            if (sum_before_this_num[sum_subscrib] == 0)
            {
                ++same_number_nums;
                ++sum_subscrib;
            } 
            else
            {
                break;
            }
        }
        ret = same_number_nums * (same_number_nums-1) / 2 + 1;
        same_number_nums = 1;

        int left_num = sum_before_this_num[sum_subscrib++];
        while (sum_subscrib<size)
        {
            if (sum_before_this_num[sum_subscrib] == left_num)
            {
                ++same_number_nums;
            } 
            else
            {
                ret += same_number_nums * (same_number_nums-1) / 2;
                left_num = sum_before_this_num[sum_subscrib];
                same_number_nums = 1;
            }

            ++sum_subscrib;
        }

        if (sum_subscrib == size)
        {
            ret += same_number_nums*(same_number_nums-1) / 2;
        }

        return ret;
    }
};

